import React, { useState } from 'react';
import styles from './Deep.module.css';

const Deep = () => {
  const [isHedisExpanded, setIsHedisExpanded] = useState(false);
  const [isFeeScheduleExpanded, setIsFeeScheduleExpanded] = useState(false);

  const toggleHedisMenu = () => {
    setIsHedisExpanded(!isHedisExpanded);
    setIsFeeScheduleExpanded(false); // Close the Fee Schedule menu
  };

  const toggleFeeScheduleMenu = () => {
    setIsFeeScheduleExpanded(!isFeeScheduleExpanded);
    setIsHedisExpanded(false); // Close the Hedis menu
  };

  return (
    <nav className={`${styles['deep-nav']} ${styles['deep-body']}`}>
      <menu className={styles['deep-menu']}>
        <li className={styles['deep-menuitem']} id="demo1">
          <menu className={styles['deep-menu']}>
            <li><a>Deep Dive Session</a></li>
            <li className={styles['deep-menuitem']} id="demo2">
              <a onClick={toggleHedisMenu}>Hedis</a>
              <menu className={`${styles['deep-menu']} ${isHedisExpanded ? styles['expanded'] : ''}`}>
                <li className={styles['deep-menuitem']} id="demo3">
                  <a>Hedis Kt(Day 1)</a>
                </li>
                <li className={styles['deep-menuitem']} id="demo4">
                  <a>Hedis Kt(Day 2)</a>
                </li>
                {/* Add more KT files here */}
              </menu>
            </li>
            <li className={styles['deep-menuitem']} id="demo5">
              <a onClick={toggleFeeScheduleMenu}>Fee Schedule</a>
              <menu className={`${styles['deep-menu']} ${isFeeScheduleExpanded ? styles['expanded'] : ''}`}>
                <li className={styles['deep-menuitem']} id="demo6">
                  <a>Hedis Kt(Day 1)</a>
                </li>
                <li className={styles['deep-menuitem']} id="demo7">
                  <a>Hedis Kt(Day 9)</a>
                </li>
                {/* Add more KT files here */}
              </menu>
            </li>
          </menu>
        </li>
      </menu>
    </nav>
  );
};

export default Deep;
